import React from "react";

const Home = ({user, token}) => {
  console.log(token)
  return (
    <>
      <h1>Stranger's Things</h1>
      {
        token ? <div>
        You are logged in as {user.username}
      </div> : 'Welcome fucker'
      } 
    </>
  );
};

export default Home;
